import logoLg from "./assets/images/logo.png";

import {
  PlayerInfo,
  PlayerInfoItem,
  PlayerInfoItemCard,
  PlayerInfoItemCardContent,
  PlayerPhoto,
  StyledPlayerHeading,
  TeamLogo,
} from "./styled-components";

import PlayerDetail from "./PlayerDetails";
import PlayerCircularStats from "./PlayerCircularStats";
import PlayerTitle, { IPlayerName } from "./PlayerTitle";
import PlayerStats, { IStatItem } from "./PlayerStats";

interface Props {
  playerName: IPlayerName;
  photo: string;
}

const data: IStatItem[] = [
  { attr: "OFF", value: 120 },
  { attr: "AST", value: 98 },
  { attr: "TCK", value: 86 },
  { attr: "TRY", value: 99 },
  { attr: "PAS", value: 85 },
  { attr: "DEF", value: 65 },
];

const PlayerHeading = ({ playerName, photo }: Props) => {
  return (
    <StyledPlayerHeading>
      <div className="container mx-auto">
        <TeamLogo>
          <img src={logoLg} alt="logo" />
        </TeamLogo>

        <PlayerTitle className="mobile" {...playerName} />

        <PlayerInfo>
          <PlayerInfoItemCard>
            <PlayerInfoItemCardContent>
              <PlayerInfoItem className="photo" aria-hidden="false">
                <PlayerPhoto>
                  <img src={photo} alt="" />
                </PlayerPhoto>
              </PlayerInfoItem>
              <PlayerInfoItem className="details" aria-hidden="false">
                <PlayerTitle {...playerName} />
                <PlayerDetail />
                <PlayerCircularStats />
              </PlayerInfoItem>
              <PlayerInfoItem className="stats" aria-hidden="false">
                <PlayerStats data={data} />
              </PlayerInfoItem>
            </PlayerInfoItemCardContent>
          </PlayerInfoItemCard>
        </PlayerInfo>
      </div>
    </StyledPlayerHeading>
  );
};

export default PlayerHeading;
